import React,{useState} from "react";

const inputEvent=(event)=>{
    const [name,setName] = useState("");
    setName(event.target.value);
    console.log(name) ;
}
function App() {
    const element = <div>
        <h1> Hello </h1>
         <input type="text" placeholder="Enter Your Name "
             onChange={inputEvent}
         />


    </div>
    return element ; 
}
export default App;
